import  React, {Component} from 'react';
import ReactDOM from 'react-dom';
import { Route, Link } from 'react-router-dom';
import {withRouter} from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import Projects from '../projects/projects';
import About from '../about/about';
import Contact from '../contact/contact';
import './home.css';

class Home extends Component {
    render() {
      return (
        <div className='Home'>
            <header className='homeHeader'>
            </header>
            <main>
            {/* <img id="LeafImage" src="https://user-images.githubusercontent.com/46304321/61665418-78194400-acc4-11e9-94fb-00bd8bef685e.jpeg"
        alt="a photo of maple leaves in water taken by Rachel Perez">  */}
      <p>My name is Rachel and I am an aspiring web developer. I currently have experience with JavaScript, JQuery, HTML, and CSS and am excited to expand my knowledge of these programming languages and others. I am based in the Boston area, but am willing
        to work remotely or relocate. </p>

            </main>
        </div>
      );
    } 
}

export default Home;
